import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-9ec44bc0bc7be",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/hujiangjun/Desktop/dev/blog-vuepress/docs/README.md").then(comp => {
        Vue.component("v-9ec44bc0bc7be", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-ba0d54f684589",
    path: "/demo/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/hujiangjun/Desktop/dev/blog-vuepress/docs/demo/README.md").then(comp => {
        Vue.component("v-ba0d54f684589", comp.default)
        next()
      })
    }
  },
  {
    path: "/demo/index.html",
    redirect: "/demo/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
